        <h1>About Falaknuma Palace</h1>

        <br>

        <div class="row">
            <div class="col-md-8">
                <p>Falaknuma Palace, situated in Hyderabad, Telangana, India, was originally owned by the Paigah family
                    before becoming the property of the Nizam of Hyderabad. Constructed by Nawab Sir Viqar-ul-Umra,
                    Prime Minister of Hyderabad, it is located on a hillock 5 kilometers from Charminar. Designed by
                    English architect William Ward Marret, the palace is an epitome of luxury, adorned with Italian
                    marble and stained-glass windows, covering a vast area of 93,970 square meters. Its unique
                    scorpion-shaped layout includes lavish quarters like Gol Bangla, Zenana Mehal, and a library with a
                    carved walnut roof. The State Reception Room boasts ornate frescoes, while the Ballroom features a
                    rare 2-ton manually-operated organ. With 60 opulent rooms and 22 grand halls, the palace holds a
                    remarkable collection of treasures, including paintings, statues, furniture, manuscripts, and a
                    renowned jade collection, making it a treasure trove of history and heritage.</p>
            </div>
            <div class="col-md-4">
                <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/f/f3/Falaknuma_Palace_01.jpg/1920px-Falaknuma_Palace_01.jpg"
                    height="270px" width="300px">
            </div>
            <br><br><br>
            <div class="col-md-4">
                <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/c/c8/Falaknuma_1900.jpg/330px-Falaknuma_1900.jpg"
                    height="270px" width="300px">
            </div>
            <div class="col-md-8">
                <p>Sir Viqar-ul-Umra, Prime Minister of Hyderabad, laid the foundation stone for Falaknuma Palace in
                    1884, inspired by European architecture. After nine years of construction, he moved into the palace
                    in 1890, utilizing it as his private residence until handing it over to the 6th Nizam of Hyderabad
                    around 1897–1898. Costing ₹4 million, borrowed from the Bank of Bengal, the palace became a guest
                    house for royal visitors, including King George V, Queen Mary, and Tsar Nicholas II. However, it
                    fell into disuse after the 1950s until leased by the Taj Group of Hotels and restored over ten
                    years, starting in 2000. Managed by Princess Esra, the palace now serves as a luxury hotel, hosting
                    notable guests like Aga Khan IV, Ivanka Trump, and Narendra Modi, revitalizing its legacy as a
                    prestigious destination in Hyderabad.
                </p>
            </div>

